import React from 'react';
import styled from 'styled-components';

const AvailabilityContainer = styled.div`
    paddding: 20px;
    background: f0f0f0;
    border-radius: 8px;
`;

const OEEAvailability = ({value}) => (
    <AvailabilityContainer>
        <h1>Availability</h1>
        <p>{value}%</p>
    </AvailabilityContainer>
);

export default AvailabilityContainer;
